import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonItem, IonButton, IonLabel } from '@ionic/react';
import './Tab1.css';
import axios from 'axios';

const API_KEY = 'YOUR_API_KEY';
const URL = 'http://localhost:5000/api/guns';

const fetchGuns = () => {

  return axios({
    url: URL,
    method: 'get'
  }).then(response => {

    console.log(response);
    return response.data;
  })
};

const Tab1: React.FC = () => {
  const [guns, setGuns] = React.useState([]);
  const items: any[] = [];

  React.useEffect(() => {

    fetchGuns().then(data => setGuns(guns));

  }, []);


let itemsToRender;
if (guns) {
  itemsToRender = guns.map(a=> {
    return <IonItem>{a['name']}<IonButton href={a['image']} color="primary" slot="end">{a['image']}</IonButton></IonItem>;
  });
}
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Tab 1</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Tab 1</IonTitle>
          </IonToolbar>
        </IonHeader>

        <IonItem>
          <IonLabel>
            Item
          </IonLabel>
        </IonItem>

        {/*-- Item as a Button --*/}
        <IonItem button onClick={() => { }}>
          <IonLabel>
            Button Item
          </IonLabel>
        </IonItem>
        {itemsToRender}
      </IonContent>
    </IonPage>
  );
};

export default Tab1;
